  background-color: #f9f9f9;
  box-shadow: 0px 0px 20px #d5d5d5;
  padding: 2px; 
  position: fixed;
  bottom: 0;
`;


const MyMenuMyGoods = () => {
  return (
    <div>
      나의 판매내역
